import React from 'react';
import { StyleSheet, View, Text, Button, Image } from 'react-native';

function Anasayfa({ route, navigation }) {
	return (
		<View style={styles.container}>
			<Text style={styles.text}>Anasayfa</Text>
			<Image source={require('../image/Household-Washing-Machine-icon.png')} />
			<Button title="Detaylar" onPress={() => navigation.navigate('Detaylar')}></Button>
		</View>
	);
}
const styles = StyleSheet.create({
	container: {
		flex: 1,
		backgroundColor: '#ddd',
	},
	text: {
		textAlign: 'center',
		fontSize: 50,
		color: '#fff',
		backgroundColor: 'red',
		padding: 10,
	},
});
export default Anasayfa;
